import React, { useEffect } from "react";
import { withRouter } from 'react-router-dom'
import Card from "../../components/card";
import FormGroup from "../../components/form-group";
import SelectMenu from "../../components/selectMenu";
import LancamentoTable from "./lancamentoTable";
import LancamentoService from "../../app/service/lancamentoService";
import LocalStorageService from "../../app/service/localStorageService";
import * as messages from "../../components/toastr";
import { Dialog } from 'primereact/dialog';
import 'primeicons/primeicons.css';


class ConsultaLancamento extends React.Component {

    state = {
        ano: '',
        mes: '',
        tipo: '',
        lancamentos: [],
        lancamentoDeletar: {},
        visibleDialogDelete: false,
        nome: '',
        produtos: [],
        produtoDeletar: {}
    }

    constructor() {
        super();
        this.service = new LancamentoService();
    }

    buscar = () => {
        if (this.state.nome != null) {
            this.service.buscarPorNome(this.state.nome).then(response => {
                this.setState({ produtos: response.data });
            }).catch(err => {
                console.log(err);
                messages.mensagemError("Erro ao buscar produtos por Nome.")
            })
        }else{
            this.service.buscarTodos().then(response => {
                this.setState({ produtos: response.data })
            }).catch(err => {
                console.log(err);
                messages.mensagemError("Erro ao buscar produtos")
            })
        }
        // let usuarioLogado = LocalStorageService.obterItem('_usuario');
        // usuarioLogado = JSON.parse(usuarioLogado)
    }

    editar = (id) => {
        console.log(id);
    }

    delete = () => {
        const produto = this.state.produtoDeletar;
        this.service.deletar(produto.id).then(response => {
            const produtos = this.state.produtos.splice(this.state.produtos.indexOf(produto), 1);
            this.setState({ produtos, visibleDialogDelete: false });
            messages.mensagemSucesso("Produto excluido.");
        }).catch(err => {
            messages.mensagemError(err);
        });
    }

    abrirDialogDelete = (lancamento) => {
        console.log(lancamento);
        this.setState({ visibleDialogDelete: true, lancamentoDeletar: lancamento });
    }

    fecharDialogDelete = () => {
        this.setState({ visibleDialogDelete: false });
    }

    render() {
        const meses = this.service.obterMeses();
        const tiposLancamentos = this.service.obterTipoDespesa();



        return (
            <Card title="Consulta Produtos">
                <div className="row" >
                    <div className="col-md-6">
                        <div className="bs-component">
                            <FormGroup htmlFor="inputNome" Label="Nome: ">
                                <input type="text"
                                    className="form-control"
                                    id="inputNome"
                                    value={this.state.nome}
                                    onChange={e => this.setState({ nome: e.target.value })}
                                    placeholder="Digite o Nome do Prduto" />
                            </FormGroup>
                            <div style={{ marginTop: 20 }}>
                                <button type="button" className="btn btn-primary" style={{ marginRight: 10 }} onClick={this.buscar}>
                                    Buscar
                                </button>
                                <button type="button" className="btn btn-info">Cadastrar</button>
                            </div>
                        </div>
                    </div>
                </div>
                <br />
                <div className="row">
                    <div className="col-md-12">
                        <div className="bs-component">
                            <LancamentoTable produtos={this.state.produtos} delete={this.abrirDialogDelete} editar={this.editar} />
                        </div>
                    </div>
                </div>
                <div>
                    <Dialog header="Excluir lancamento" visible={this.state.visibleDialogDelete} style={{ width: '50vw' }}
                        onHide={() => this.setState({ visibleDialogDelete: false })}>
                        <p className="m-0 ">
                            Tem certeza que deseja excluir esse Lancamento ?
                        </p>
                        <button className="btn btn-danger" onClick={this.delete} style={{marginRight: 10}}> Deletar</button>
                        <button className="btn btn-secondary" onClick={this.fecharDialogDelete}>cancelar</button>
                    </Dialog>
                </div>
            </Card>
        )
    }
}
export default ConsultaLancamento;
